import logo from './logo.svg';
import './App.css';
import { useState } from 'react';

function App() {

  const [cellOne, setCellOne] = useState("empty");
  const handleCellOne = () => {
    if (cellOne == "empty") {
      console.log("Cell one is now occupied!")
    } else {
      setCellOne = "full";
    }
  }

  return (
    <div className='App'>
      <header className="App-header">
        <h1>Tic-Tac-Toe Game</h1>
      </header>
      <div>Sina</div>
      <table>
        <tbody>
          <tr>
            <td>
              <input type="checkbox" onChange={() => handleCellOne(1)}></input>
              <text>Filled out: {cellOne}</text>
            </td>
            <td><input type="checkbox"></input></td>
            <td><input type="checkbox"></input></td>
          </tr>

          <tr>
            <td><input type="checkbox"></input></td>
            <td><input type="checkbox"></input></td>
            <td><input type="checkbox"></input></td>
          </tr>

          <tr>
            <td><input type="checkbox"></input></td>
            <td><input type="checkbox"></input></td>
            <td><input type="checkbox"></input></td>
          </tr>
        </tbody>
      </table>
    </div>
  );
}

export default App;
